import React from "react";
import ImageWithBorder from "../../components/ImageWithBorder";
import Title from "../../components/Title";
import Star from "../../components/Star";
import Text from "../../components/Text";
import FlexDiv from "../../components/FlexDiv";

export default function TopBanner({data}) {
    return (
        <div className="top-banner flex">
            <div className={"flex flex-row items-center gap-10 lg:px-20 py-5"}>
                <ImageWithBorder logo={data.image_src}></ImageWithBorder>
                <div>
                    <div className={"flex flex-row items-center gap-3"}>
                        <Title className={"font-bold text-xl"} text={data.name}></Title>
                        <Star></Star>
                    </div>
                    <FlexDiv className={"gap-3 flex mt-3"}>
                        <Text className={"font-bold"} text={"Stadion"}></Text>
                        <Text text={"Stadion"}></Text>
                    </FlexDiv>

                </div>
            </div>
        </div>
    );
}
